import '../styles/Postagem.css'; // Import the CSS file directly
import '../styles/'

function Postagem() {
    return (
        <div className="postagem">
            <header id="navbar">
                <h1>Feed</h1>
            </header>
            <main>
                {/* Your main content goes here */}
            </main>
            <div id="endPage" aria-hidden="true"></div>
            {/* Optionally, include script tags if you need to load external scripts */}
            {/* <script src="script.js"></script> */}
        </div>
    );
}

export default Postagem;
